const movieData = {
    movies: [
        { id: 1, movieName: "A" },
        { id: 2, movieName: "B" },
        { id: 3, movieName: "C" },
        { id: 4, movieName: "D" },
        { id: 5, movieName: "E" }
    ],
    selectedMovie: []
}

function MainAap() {
    const [state, setState] = useState(movieData)

    const handller = (e) => {
        console.log(e.target.value);
    }
    return <div className="mainMovie">
        <FormSec />

        <div className="cards">
            {state.movies.map((item) => {
                return <MovieCard key={item.id} data={item} />
            })}
        </div>
        <button>Selected Movie</button>
    </div>
}
export default MainAap
